Description: After the extraordinary success of Spider-Man XXX, award-winning director Axel Braun and world leader Vivid Entertainment join forces once again for a new high-budget, sexy, superhero-themed spoof. Featuring the most complete Avengers line-up ever brought to the screen, and all the painstaking attention to detail that fans have come to expect from Braun's work, The Avengers XXX is another delightfully entertaining labor of love that will please even the most hardcore comic book fans...in more ways than one.
